using Microsoft.VisualStudio.TestTools.UnitTesting;
using FluentAssertions;
using VampireSwansong.Editor;
using System;

namespace SaveGameTests;

[TestClass]
public class Parser_IntegrationTests
{
    const string _saveGameAsBase64 = "";

    const string _galeb = "";
    const string _emem = "";
    const string _leysha = "";

    [DataTestMethod]
    public void BasicParsing_Success()
    {
        var data = Convert.FromBase64String(_saveGameAsBase64);
        var parser = new SaveGameParser(data);
        var save = parser.Parse();

        save.Should().NotBeNull();
    }

    [DataTestMethod]
    public void Emem_SkillsParsing_Success()
    {
        var data = Convert.FromBase64String(_emem);
        var parser = new SaveGameParser(new byte[] { 1, 2, 3 });
        var save = parser.CharacterAttributesParser(data);

        save.Should().NotBeNull();

        save.Physical!.Value.Should().Be(1);
        save.Social!.Value.Should().Be(1);
        save.Mental!.Value.Should().Be(1);
        save.Rhetoric!.Value.Should().Be(0);//Etiquette
        save.Intimidation.Should().BeNull();//?
        save.Persuasion!.Value.Should().Be(1);
        save.Psychology!.Value.Should().Be(0);
        save.Security.Should().BeNull();
        save.Technology.Should().BeNull();
        save.Deduction.Should().BeNull();
        save.Education.Should().BeNull();
    }

    [DataTestMethod]
    public void Leysha_SkillsParsing_Success()
    {
        var data = Convert.FromBase64String(_leysha);
        var parser = new SaveGameParser(new byte[] { 1, 2, 3 });
        var save = parser.CharacterAttributesParser(data);

        
        save.Should().NotBeNull();

        save.Physical.Should().NotBeNull();
        save.Physical!.Value.Should().Be(1);
        save.Social.Should().NotBeNull();
        save.Social!.Value.Should().Be(1);
        save.Mental.Should().NotBeNull();
        save.Mental!.Value.Should().Be(1);
        save.Rhetoric.Should().BeNull();
        save.Intimidation.Should().BeNull();
        save.Persuasion.Should().BeNull();
        save.Psychology.Should().NotBeNull();
        save.Psychology!.Value.Should().Be(1);
        save.Security.Should().BeNull();
        save.Technology.Should().BeNull();
        save.Deduction.Should().BeNull();
        save.Education.Should().BeNull();
    }

    [DataTestMethod]
    public void Galeb_SkillsParsing_Success()
    {
        var data = Convert.FromBase64String(_galeb);
        var parser = new SaveGameParser(new byte[] { 1, 2, 3 });
        var save = parser.CharacterAttributesParser(data);

        save.Should().NotBeNull();
        save.Physical.Should().NotBeNull();
        save.Physical!.Value.Should().Be(3);
         save.Social.Should().NotBeNull();
        save.Social!.Value.Should().Be(3);
        save.Mental.Should().NotBeNull();
        save.Mental!.Value.Should().Be(2);
        save.Rhetoric.Should().NotBeNull();
        save.Rhetoric!.Value.Should().Be(2);
        save.Intimidation.Should().NotBeNull();
        save.Intimidation!.Value.Should().Be(2);
        save.Persuasion.Should().NotBeNull();
        save.Persuasion!.Value.Should().Be(3);
        save.Psychology.Should().NotBeNull();
        save.Psychology!.Value.Should().Be(3);
        save.Security.Should().NotBeNull();
        save.Security!.Value.Should().Be(1);
        save.Technology.Should().NotBeNull();
        save.Technology!.Value.Should().Be(2);
        save.Deduction.Should().NotBeNull();
        save.Deduction!.Value.Should().Be(3);
        save.Education.Should().NotBeNull();
        save.Education!.Value.Should().Be(3);
    }
}
